import React, {Component} from 'react';

class Foodtit extends Component {

    componentDidMount(){
        this.setState({
            tit:this.props.tit
        })
        // console.log(this.props.tit)
    }
    render() {
        return (
            <div className="head">
                <span className="iconfont icon-jiantou"></span>
                {this.state.tit}
            </div>
        );
    }
}

export default Foodtit;
